import React, { useEffect, useState, useRef } from 'react'
import QRCode from 'qrcode.react';
import { gzip } from 'pako';

export default function Carousel() {
    // QAPM
    let dataURL = ""

    const [cur, setCur] = useState(0)
    const [carouselBegin, setCarouselBegin] = useState(true)
    const carousel = useRef(null)
    const gotoRef = useRef(null)

    useEffect(() => {
        const id = setInterval(() => {
            setCur(cur => cur + 1)
        }, 100)
        carousel.current = id
    }, [])

    // // gzip
    // console.log('pre: ', dataURL.length)
    // function bin2Str(array) {
    //     return String.fromCharCode.apply(String, array);
    // }
    // dataURL = bin2Str(gzip(dataURL));
    // console.log('new: ', dataURL.length)

    // // 功能
    function goto() {
        if (gotoRef.current.value !== '') {
            clearInterval(carousel.current)
            setCarouselBegin(false)
            setCur(gotoRef.current.value - 1)
        }
    }

    function carouselContinue() {
        if (carouselBegin === false) {
            setCarouselBegin(true)
            carousel.current = setInterval(() => {
                setCur(cur => cur + 1)
            }, 100)
        }
    }

    function carouselStop() {
        clearInterval(carousel.current)
        setCarouselBegin(false)
    }

    // 分割 base64 并放入二维码中
    const length = 700
    let num = parseInt(dataURL.length / length)
    if (dataURL.length % length !== 0) {
        num++;
    }
    console.log('总共展示图片：' + num + ' 张')

    let textArray = []

    for (let i = 0; i < num; i++) {
        let temp_text = ""
        if (num < 10) {
            temp_text += "00" + num + "-"
        }
        else if (num < 100) {
            temp_text += "0" + num + "-"
        }
        else {
            temp_text += num + "-"
        }
        if (i + 1 < 10) {
            temp_text += "00" + (i + 1)
        }
        else if (i + 1 < 100) {
            temp_text += "0" + (i + 1)
        }
        else {
            temp_text += (i + 1)
        }
        if ((i + 1) * length > dataURL.length) {
            temp_text += dataURL.slice(i * length)
        }
        else {
            temp_text += dataURL.slice(i * length, (i + 1) * length)
        }
        // console.log(temp_text)
        textArray.push(temp_text)
    }

    return (
        <div>
            <div>{cur} --- {num}</div>
            < QRCode
                id="qrCode"
                value={textArray[cur % num]}
                size={500} // 二维码的大小
                fgColor="#000000" // 二维码的颜色
                style={{ margin: 'auto' }}
            // imageSettings={{ // 二维码中间的logo图片
            //     src: 'logoUrl',
            //     height: 100,
            //     width: 100,
            //     excavate: true, // 中间图片所在的位置是否镂空
            //     // level: 'H',
            //     level: 'L',
            // }}
            />
            <input ref={gotoRef} onKeyDown={(e) => { if (e.key === 'Enter') goto() }} type="text" /><button onClick={goto}>点击跳转二维码</button>
            <button onClick={carouselStop}>停止轮播展示二维码</button>
            <button onClick={carouselContinue}>继续轮播展示二维码</button>
        </div >

    )
}
